import React from 'react';

// material-ui
import {  Autocomplete, Paper, InputAdornment, CardContent, Checkbox, FormControlLabel, Grid, MenuItem, TextField } from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from 'ui-component/cards/SubCard';
import MaskedInput from 'react-text-mask';

// assets
import EmailTwoToneIcon from '@material-ui/icons/EmailTwoTone';

const referralSourcesList = [
    { label: 'The Dark Knight', id: 1 },
];

const ReferralSource = () => (
    <SubCard title='Source of Referral'>
        <CardContent>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12} sm={12} lg={8} md={8}>

                    <Autocomplete
                        disablePortal
                        options={referralSourcesList}
                        defaultValue={referralSourcesList[0]}
                        renderInput={(params) => <TextField {...params} label="Referral Source" />}
                    />

                </Grid>
            </Grid>
        </CardContent>
    </SubCard>
);

export default ReferralSource;
